void transpose_submit_3(int M, int N, int A[64][64], int B[64][64])
{
	int i, j, m, n;
	int bsize, Bsize;
	int count = 0;
	int val0, val1, val2, val3;
	int num;
	bsize = 4;
	Bsize = 8;
	for (i = 0; i < N; i += Bsize) {
		for (j = 0; j < M; j += Bsize) {
			//if ((count % 9) != 0) {
				for (n = i; n < i + bsize; n++) {
					for (m = j; m < j + bsize; m++) {
						B[m][n] = A[n][m];
						B[m+bsize-1-2*(m-j)][n+bsize] = A[n][m+bsize];
					}
				}
				for (n = i + bsize; n < i + Bsize; n++) {
					for (m = j + bsize; m < j + Bsize; m++) {
						B[m + bsize - 1 - 2 * (m - j - bsize)][n - bsize] = A[n][m - bsize];
						B[m][n] = A[n][m];
					}
				}
				for (m = j; m < j + bsize; m++) {
					val0 = B[m][i + bsize];
					val1 = B[m][i + bsize + 1];
					val2 = B[m][i + bsize + 2];
					val3 = B[m][i + bsize + 3];
					for (int n = i; n < i + bsize; n++) {
						B[m][n + bsize] = B[m + bsize + 3 - 2 * (m - j)][n];
					}
					B[m + bsize + 3 - 2 * (m - j)][i] = val0;
					B[m + bsize + 3 - 2 * (m - j)][i+1] = val1;
					B[m + bsize + 3 - 2 * (m - j)][i+2] = val2;
					B[m + bsize + 3 - 2 * (m - j)][i+3] = val3;
				}
			//}
			//count++;
		}
	}
}
